version":1}},"settings":{"compilationTarget":{"contracts/SiloOracle.sol":"SiloOracle"},"evmVersion":"london","libraries":{},"metadata":{"bytecodeHash":"ipfs","useLiteralContent":true},"optimizer":{"enabled":true,"runs":200},"remappings":[]},"sources":{"contracts/SiloOracle.sol":{"content":"// SPDX-License-Identifier: BUSL-1.1
pragma solidity 0.8.7;

import './interfaces/ISiloOracle.sol';
import './interfaces/IOracle.sol';

import 'hardhat/console.sol';

contract SiloOracle is ISiloOracle {
    uint256 public constant ONE = 10**18;

    address public immutable factory;
    address public quoteToken;

    struct OracleData {
        address oracleImpl;
        bytes data;
    }

    mapping(address => OracleData) public oracles;

    modifier onlyFactory() {
        require(msg.sender == address(factory), "SiloOracle: onlyFactory");
        _;
    }

    constructor(address _quoteToken, address _factory) {
        factory = _factory;
        quoteToken = _quoteToken;
    }

    function registerToken(address _token, address _oracle, bytes memory _data) external override onlyFactory {
        require(IOracle(_oracle).isSiloOracle(), "SiloOracle: not an oracle");
        oracles[_token] = OracleData(_oracle, _data);
        IOracle(_oracle).initToken(_token, quoteToken, _data);
        console.log('oracles[_token].data.length', oracles[_token].data.length);
        console.log('oracles[_token].data');
        console.logBytes(oracles[_token].data);
    }

    function getPriceStatic(address _token) public view returns (uint256) {
        console.log('getPrice._token', _token);
        if (_token == quoteToken) return ONE;
        console.log('oracles[_token].oracleImpl', oracles[_token].oracleImpl);
        console.log('_token', _token);
        console.log('quoteToken', quoteToken);
        console.log('oracles[_token].data.length', oracles[_token].data.length);
        console.log('oracles[_token].data');
        console.logBytes(oracles[_token].data);
        return IOracle(oracles[_token].oracleImpl).getPriceStatic(_token, quoteToken, oracles[_token].data);
    }

    function getPrice(address _token) public virtual override returns (uint256) {
        console.log('getPrice._token', _token);
        return getPriceQuote(_token, quoteToken);
    }

    function getPriceQuote(address _base, address _quote) public returns (uint256) {
        if (_base == _quote) return ONE;
        console.log('oracles[_base].oracleImpl', oracles[_base].oracleImpl);
        console.log('_base', _base);
        console.log('_quote', _quote);
        console.log('oracles[_base].data.length', oracles[_base].data.length);
        console.log('oracles[_base].data');
        console.logBytes(oracles[_base].data);
        return IOracle(oracles[_base].oracleImpl).getPrice(_base, _quote, oracles[_base].data);
    }
}
