pragma solidity >=0.6.0 <0.9.0;

interface IOracle {
    function initToken(address _base, address _quote, bytes calldata _data) external;
    function isSiloOracle() external pure returns (bool);
    function getPrice(address _base, address _quote, bytes calldata _data) external returns (uint256 price);
    function getPriceStatic(address _base, address _quote, bytes calldata _data) external view returns (uint256 price);
}
